import beat1 from '../beataudios/davu_tagged_mp3.mp3';
import beat2 from '../beataudios/jewry_tagged_mp3.mp3';
import beat3 from '../beataudios/made_it_tagged_mp3.mp3';
import beat4 from '../beataudios/nuisance_tagged_mp3.mp3';
import beat5 from '../beataudios/pages_tagged_mp3.mp3';


export const songsArr = [
    [
      "Davu Instrumental",
      beat1
    ],
    [
      "Jewry Instrumental",
      beat2
    ],
    [
      "Made It Instrumental",
      beat3
    ],
    [
      "Nuisance Instrumental",
      beat4
    ],
    [
      "Pages Instrumental",
      beat5
    ],
  ];
